import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Locate the search input and type a query
    const searchInput = page.locator('#searchInput');
    await searchInput.waitFor({ state: 'visible', timeout: 5000 });
    const searchTerm = 'phone';
    await searchInput.fill(searchTerm);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_typed_in_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_typed_in_search.png'));

    // 2. Wait for autocomplete suggestions to appear
    await page.waitForSelector('.search-suggestions', { state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_suggestions_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_suggestions_visible.png'));

    // 3. Extract suggestion text and click the first one
    const firstSuggestion = page.locator('.suggestion-item').first();
    const firstSuggestionText = await firstSuggestion.textContent();

    const allSuggestions = await page.locator('.suggestion-item').allTextContents();

    await firstSuggestion.click();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_suggestion_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_suggestion_clicked.png'));

    // 4. Verify the search input value was updated
    const finalInputValue = await searchInput.inputValue();

    if (finalInputValue !== firstSuggestionText) {
      throw new Error(`Search input value was not updated correctly. Expected: "${firstSuggestionText}", Got: "${finalInputValue}"`);
    }

    return {
      success: true,
      action: "Tested search autocomplete functionality",
      extractedData: {
        searchTerm,
        clickedSuggestion: firstSuggestionText,
        allSuggestions,
        finalInputValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Taking a screenshot on failure can be helpful for debugging
    const screenshotsOnFailure = [];
    try {
        const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
        await page.screenshot({ path: errorScreenshotPath });
        screenshotsOnFailure.push(errorScreenshotPath);
    } catch (e) {
        // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to test search autocomplete",
      extractedData: {},
      screenshots: screenshotsOnFailure,
      error: error.message
    };
  }
}
